import axios from "axios";



export class PersonaService{


    baseUrl="http://localhost:56388/api"
    getAll(){
        return axios.get(this.baseUrl+"/Empleadoes")
        .then(res => res.data)

        .then((responseData) => {
            console.log("Console log de products responseData");
            console.log(responseData);
        })
        .catch(function(e) {
            console.log(e);
        })
        
    }
}
